import React from 'react'

// eslint-disable-next-line import/no-anonymous-default-export
export default function(props){
    return( <div>
                <h2>{props.titulo}</h2>
                <h3>{props.aluno} tem nota {props.nota}</h3>
                <h4>{props.nota}</h4>
            </div>
        )
}
